import redditLogo from '../../../images/logos/reddit-logo.png';
import twitterLogo from '../../../images/logos/twitter-logo.png';
import youtubeLogo from '../../../images/logos/youtube-logo.png';
import discordLogo from '../../../images/logos/discord-logo.png';
import instagramLogo from '../../../images/logos/instagram-logo.webp';
import threadsLogo from '../../../images/logos/threads-logo.png';


const CompanyData = [
    {
        "name": "Reddit",
        "description": "Effortlessly refine your Reddit presence. Remove posts, comments, or private messages selectively, either within a specific timeframe or since the inception of your account.",
        "img": redditLogo
    },
    {
        "name": "Twitter",
        "description": "Optimize your Twitter presence with ease. Tailor your feed by deleting tweets, replies, or direct messages based on your preferences, whether it's within a specific timeframe or since your account's inception.",
        "img": twitterLogo
    }, 
    {
        "name": "YouTube",
        "description": "Refine your YouTube presence effortlessly. Tailor your content by removing videos, comments, or private messages based on your criteria, whether it's within a specific timeframe or since the establishment of your channel.",
        "img": youtubeLogo
    },
    {
        "name": "Discord",
        "description": "Enhance your Discord profile seamlessly. Customize your online experience by selectively removing messages, chats, or server activity based on your preferences, whether it's within a specific timeframe or since the creation of your account.",
        "img": discordLogo
    }, 
    {
        "name": "Instagram",
        "description": "Elevate your Instagram profile effortlessly. Curate your feed by selectively removing posts, comments, or direct messages to suit your preferences, whether it's within a specific timeframe or since the inception of your account.",
        "img": instagramLogo
    },
    {
        "name": "Threads",
        "description": "Optimize your threaded conversations with ease. Customize your discussion by selectively removing posts, comments, or messages to fit your criteria, whether it's within a specific timeframe or since the initiation of the thread.",
        "img": threadsLogo
    }
]

export default CompanyData;
